import React from 'react';
import Login from './components/login';
import './styles/style.css'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className='content'>
        <Switch>
          <Route path="/a">
            <p>aa</p>
          </Route>
          <Route path="/">
            <Login/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
